class Solution {
  private:
  public:
  long long dividePlayers(std::vector<int>& skill) {
    const auto N = skill.size();
    const uint64_t total =
        std::accumulate(skill.begin(), skill.end(), 0, std::plus{});
    const uint64_t target_sum = total / (N / 2);
    if (total % (N / 2) > 0) return -1;
    std::vector<int> counts(2001, 0);
    for (int j = 0; j < N; j++) {
      counts[skill[j]]++;
    }
    uint64_t chemistry = 0;
    int pairs = 0;
    for (int i = 0; i < N; i++) {
      if (counts[skill[i]] && counts[target_sum - skill[i]]) {
        chemistry += skill[i] * (target_sum - skill[i]);
        counts[skill[i]]--;
        counts[target_sum - skill[i]]--;
        pairs++;
      }
    }
    return pairs == N / 2 ? chemistry : -1;
  }
};

struct TestVec {
  std::vector<int> skill;
  long long expected;
};

class ParamTest : public ::testing::TestWithParam<TestVec> {};

TEST_P(ParamTest, Example) {
  auto tv = GetParam();

  EXPECT_EQ(tv.expected, Solution().dividePlayers(tv.skill));
}

